Storyline

Follows a group of friends that decide to go snowmobiling during their winter break. They make a &quot;wrong turn&quot;, getting lost in a storm, and seek shelter in an abandoned sanatorium. They are completely isolated by the storm and are thankful they can get out of the elements. But the sanatorium has a troubled past, and some of its former patients still reside there and are not happy about the intrusion. In a deadly game of cat and mouse, the college kids must fight to survive the night.
